import React from 'react'
 class Main extends React.Component{
    
     render(){
        const style ={
            backgroundColor: "#f5dfb8",
                width: 300,
                border: "5px solid ",
                padding: 50,
                margin: 20
          
    }
        return (
            <div className ="Movie-names" style={style}>
                <h2>{this.props.movie.name}</h2>
                <img src={this.props.movie.imgUrl}width ="300" height="250" alt ="" />
                <p>Date :{this.props.movie.date} </p>
            </div>
        )
     }
 }
 export default Main
